
/* global jspdf */

import React, { Component } from 'react';
import  jsPDF from '../node_modules/jspdf/dist/jspdf.debug.js';

import './UI.css'

class UI extends Component {
    constructor(props) {
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this);
        this.handleChange = this.handleChange.bind(this);
        this.updatePreview = this.updatePreview.bind(this);
        this.update_Preview_Button = document.getElementById('flyer_preview_btn');
        // this.download_Button = document.getElementById('flyer_download_btn');
        this.state = {
            title:'please set title',
            update_preview: false,
            preview_available: null,
            src: null
        };


    }

    componentWillMount(){
        this.setState({
            preview_available: this.canRenderPreview(),
        });
    }

    componentDidMount(){
    }

    handleChange(event) {
        event.preventDefault();
        console.log(event.target);
        this.setState({title: event.target.value});
    }

    updatePreview(event) {
        event.preventDefault();
        console.log(event.target);
        this.createpdf(true);
    }

    handleSubmit(event) {
        event.preventDefault();
        console.log(event.target);
        this.createpdf(false);
    }


    createpdf(bool) {
        
        event.preventDefault();
        // let email_val = document.getElementById('name').value;
        // var imgData = 'data:image/jpeg;base64,';
        var imgData = 'data:image/jpeg;base64,';
        var title = this.state.title;
        
        var doc = new jsPDF({
          orientation: 'landscape',
          unit: 'in',
          format: [11, 8.5]
        })
        doc.setFontSize(36);
        
        doc.addImage(imgData, 'JPEG', 0,0, 11, 8.5 );
        doc.setTextColor(255, 0, 0);
        doc.text(120, 50, this.state.title);
        // doc.save('a4.pdf')

        // ****************************
        // output
        if (bool) {
            this.setState({src:doc.output('datauristring')})
            // document.getElementById('preview_Container').attr('src', doc.output('datauristring'));
        } else {
            doc.save(title + '-flyer.pdf');
        }
    }

    getBackgroundImage(){}

    canRenderPreview(){
        // preview can be displayed?
        if (navigator.msSaveBlob) { // older IE
            this.update_Preview_Button.prop('disabled', true);
            this.preview_Container.replaceWith(
                    '<div class="no_iframe">' +
                    '<div>' +
                    "The preview can't be displayed" +
                    '</div>' +
                    '</div>'
            );
            console.log('no preview available');
        } else {
            console.log('preview availabe');
        }
    }

    render() {
        return (
            <div className="container-fluid flyer-builder">
                <div className="row">
                    <div className="col-sm-6 loc_form">
                        <div className="form-group">
                            <label htmlFor="flyer-image" className="control-label">Image</label>
                            <input id="flyer-image" type="file" tabIndex="1"/>
                        </div>

                        <div className="row">
                            <div className="col-sm-7">
                                <div className="form-group">
                                    <label htmlFor="flyer-title" className="control-label">Title</label>
                                    <input required className="form-control" id="flyer-title" placeholder="Title..." value={this.state.title} onChange={this.handleChange} maxLength="255" type="text" tabIndex="2"/>
                                </div>
                            </div>
                            <div className="col-sm-3">
                                <div className="form-group">
                                    <label htmlFor="flyer-title-size" className="control-label">Size (pt)</label>
                                    <input required className="form-control" id="flyer-title-size" value="60" min="1" step="1" type="number" tabIndex="3" title="Title size: tune it to fit the available space"/>
                                </div>
                            </div>
                            <div className="col-sm-2">
                                <div className="form-group">
                                    <label htmlFor="flyer-title-color" className="control-label">Color</label>
                                    <input required className="form-control" id="flyer-title-color" value="#0080FF" type="color" tabIndex="4" title="Title color"/>
                                </div>
                            </div>
                        </div>
                        <div className="form-group">
                            <label className="control-label" htmlFor="flyer-description">Description</label>
                            <textarea className="form-control" id="flyer-description" placeholder="Insert a short description..."></textarea>
                        </div>

                        <div className="row">
                            <div className="col-sm-6">
                                <div className="form-group">
                                    <button id="flyer_preview_btn" type="button" className="btn btn-primary btn-block" tabIndex="9" onClick={this.updatePreview}>Update preview</button>
                                </div>
                            </div>
                            <div className="col-sm-6">
                                <div className="form-group text-right">
                                    <button id="flyer_download_btn" type="button" className="btn btn-primary btn-xs btn-block" tabIndex="10" onClick={this.handleSubmit}>Download</button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <div className="row">
                    {/*iframe*/}
                    <div className="col-sm-6">
                        <iframe id="pdf_preview" type="application/pdf" src={this.state.src}></iframe>
                    </div>
                    <div className="col-sm-6">
                        <p id="preview_Container"></p>
                    </div>
                </div>
            </div>

      );
  }
}

export default UI;
